import React from 'react';
import {useState} from "react";

const Render = () => {
    const [count, setCount] = useState(0)
    return (
        <div>
            count: {count}
            <button onClick={() => {setCount(count + 1)}}>+</button>
        </div>
    )

}

export default Render
